// Import
import React, { useState, useEffect} from "react";
import { useNavigate, useOutletContext, Link, useParams } from "react-router-dom";

// Functional Component
const BentleyDetail = () => {
    const { bentleyState: [bentley, setBentley] } = useOutletContext();
    const navigate = useNavigate();
    const {carId} = useParams();

    const [localCar, setLocalCar] = useState({})

    // fetchBentleyDetail
    useEffect (() => {
        console.log("BID", carId)
        async function fetchBentleyDetail(){
            // Fetch;
            try{
                const response = await fetch (`https://car-haven-back.onrender.com/api/bentley/${carId}`,{
                    headers: {
                        'Content-Type' : 'application/json'
                    }
                })
                // Translate the promise data;
                console.log("Response:", response)
                const car = await response.json();
                console.log("Here is translated Json:", car)
                setLocalCar(car)
            } catch (error)
                {console.error(error)}
            // Set the State
        }
        fetchBentleyDetail()
    }, [])

    // Return
    return(
        <div className="more-detail">
            {/* Name */}
            {
                LocalCar.make ?
                <p id="recipe-detail-name">{LocalCar.make}</p>:
                <p>Name can not be viewed</p>
            }

            {/* Description */}
            {
                LocalCar.model ?
                <p id="recipe-detail-description">{LocalCar.model}</p>:
                <p>Description can not be viewed</p>
            }

            {/* Images */}
            {
                LocalCar.imageOne ?
                <img src={LocalCar.imageOne} id="recipe-detail-image"></img>:
                <p>Image can not be viewed</p>
            }
            {
                LocalCar.imageTwo ?
                <img src={LocalCar.imagetwo} id="recipe-detail-image"></img>:
                <p>Image can not be viewed</p>
            }
            {
                LocalCar.imageThree ?
                <img src={LocalCar.imageThree} id="recipe-detail-image"></img>:
                <p>Image can not be viewed</p>
            }
            {
                LocalCar.imageFour ?
                <img src={LocalCar.imageFour} id="recipe-detail-image"></img>:
                <p>Image can not be viewed</p>
            }
            {
                LocalCar.imageFive ?
                <img src={LocalCar.imageFive} id="recipe-detail-image"></img>:
                <p>Image can not be viewed</p>
            }
            {
                LocalCar.imageSix ?
                <img src={LocalCar.imageSix} id="recipe-detail-image"></img>:
                <p>Image can not be viewed</p>
            }
            {
                LocalCar.imageSeven ?
                <img src={LocalCar.imageSeven} id="recipe-detail-image"></img>:
                <p>Image can not be viewed</p>
            }
            {
                LocalCar.imageEight ?
                <img src={LocalCar.imageEight} id="recipe-detail-image"></img>:
                <p>Image can not be viewed</p>
            }

            {/* Go Back Button */}
            <button onClick={() => navigate(-1)} id="go-back-button">Back</button>
        </div>
    )
};

// Export
export default BentleyDetail;
